import React from "react";
import { SafeAreaView, TextInput, StyleSheet, Text, View } from "react-native";
import StyledText from "./StyledText";
import { FloatingLabelInput } from 'react-native-floating-label-input';

function Signup(props) {
    const [text, setText] = useState('');

  return (
    <SafeAreaView>
      <View style={styles.container}>
        <FloatingLabelInput
         label="Phone"
         value={text}
         staticLabel
         hintTextColor={'#aaa'}
         mask="99 (99) 99999-9999"
         hint="55 (22) 98765-4321"
         containerStyles={{
            borderWidth: 2,
            paddingHorizontal: 10,
            backgroundColor: '#fff',
            borderColor: 'blue',
            borderRadius: 8,
          }}
          customLabelStyles={{
            colorFocused: 'red',
            fontSizeFocused: 12,
          }}
          labelStyles={{
            backgroundColor: '#fff',
            paddingHorizontal: 5,
          }}
          inputStyles={{
            color: 'blue',
            paddingHorizontal: 10,
          }}
          onChangeText={value => {
            setText(value);
          }}
         />
      </View>
    </SafeAreaView>
  );
}
const styles = StyleSheet.create({
  input: {
    height: 40,
    margin: 12,
    borderWidth: 1,
    padding: 10,
  },
  container: {
    padding: 20,
    paddingBottom: 5,
    paddingTop: 5,
  },
  label:{
      textAlign: "right",
  }
});

export default Signup;
